import React from 'react'

export default class SnapMap extends React.Component {
    componentDidMount() {
     let Snap = require('snapsvg');
    Snap(props.mapref);
    let myCircle = Snap.circle(20, 20, 20)
    myCircle.attr({ 
        stroke: '#123456', 
        'strokeWidth': 3,
        fill: '#123456', 
        'opacity': 0.2 })
    }

   render(){

        return ( <svg />)
   }


}
